import React, { useState, useEffect } from 'react';
import api from '../api/api';
import './AdminDashboard.css';

const AdminDashboard = () => {
    const [products, setProducts] = useState([]);
    const [file, setFile] = useState(null);
    const [uploading, setUploading] = useState(false);
    const [uploadResult, setUploadResult] = useState(null);

    useEffect(() => {
        fetchProducts();
    }, []);

    const fetchProducts = async () => {
        try {
            const response = await api.get('/products');
            setProducts(response.data.data);
        } catch (error) {
            console.error('Error fetching products:', error);
        }
    };

    const handleDelete = async (id) => {
        if (!window.confirm('Are you sure you want to delete this product?')) {
            return;
        }

        try {
            await api.delete(`/products/${id}`);
            fetchProducts();
        } catch (error) {
            alert('Failed to delete product');
        }
    };

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
    };

    const handleBulkUpload = async (e) => {
        e.preventDefault();
        if (!file) {
            alert('Please select a file');
            return;
        }

        setUploading(true);
        setUploadResult(null);

        const formData = new FormData();
        formData.append('file', file);

        try {
            const response = await api.post('/products/bulk-upload', formData, {
                headers: { 'Content-Type': 'multipart/form-data' }
            });

            setUploadResult(response.data.data);
            fetchProducts();
            setFile(null);
        } catch (error) {
            alert('Bulk upload failed: ' + error.response?.data?.message);
        } finally {
            setUploading(false);
        }
    };

    return (
        <div className="admin-container">
            <h1>Admin Dashboard</h1>

            {/* Bulk Upload Section */}
            <div className="bulk-upload-section">
                <h3>Bulk Upload Products (CSV/Excel)</h3>
                <form onSubmit={handleBulkUpload} className="upload-form">
                    <input
                        type="file"
                        accept=".csv,.xlsx,.xls"
                        onChange={handleFileChange}
                    />
                    <button type="submit" disabled={!file || uploading}>
                        {uploading ? 'Uploading...' : 'Upload CSV'}
                    </button>
                </form>

                {uploadResult && (
                    <div className="upload-result">
                        <p>✅ Uploaded {uploadResult.success.length} products</p>
                        {uploadResult.errors.length > 0 && (
                            <p>❌ {uploadResult.errors.length} errors</p>
                        )}
                    </div>
                )}
            </div>

            {/* Products Table */}
            <div className="products-table">
                <h3>All Products</h3>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Price</th>
                            <th>Stock</th>
                            <th>Category</th>
                            <th>Edit</th>
                            <th>Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                        {products.map((product) => (
                            <tr key={product._id}>
                                <td>{product.name}</td>
                                <td>${product.price}</td>
                                <td>{product.stock}</td>
                                <td>{product.category}</td>
                                <td>
                                    <button className="btn-edit">Edit</button>
                                </td>
                                <td>
                                    <button
                                        className="btn-delete"
                                        onClick={() => handleDelete(product._id)}
                                    >
                                        Delete
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default AdminDashboard;
